description:
Leviathan is a concept album by progressive metal band Mastodon, released in 2004 by Relapse Records. The album is based on the Herman Melville novel Moby-Dick. Its songs &quot;Iron Tusk&quot;, &quot;Blood and Thunder&quot; and &quot;Seabeast&quot; were released as singles. Three magazines awarded it Album of the Year in 2004: Revolver, Kerrang!, and Terrorizer.The album brought Mastodon great critical acclaim and, thanks to the ensuing tour, a considerably larger fan base. Leviathan has sold 103,000 copies as of September, 2006.




